import GlobalLayout from '../components/GlobalLayout.js'
import { withRouter } from 'next/router'
import CustomPage from '../components/CustomPage.js'

function Index(props) {
    var page = props.router.query.page ? props.router.query.page : props.router.route.toString().slice(1);
    console.log(page);
    return (
        <GlobalLayout>
            <CustomPage name={props.router.query.page}/>
        </GlobalLayout>
    )
}

export default withRouter(Index)
